import './styles/Badges';
import NavBar from '../components/Navbar';
class Badges extends React.Component {
    render() {
        return (
            <div>
        <NavBar/>
        <div className="Badges">
            <div className=".Badges__hero">
            <div className="Badges__container"></div>
            </div>

        </div>
            </div>
        )
    }
}

export default Badges;
